import ReactDOM from "react-dom";
import { Container } from "@material-ui/core";
import { Grid } from "@material-ui/core";
import Nav from './Nav'
import './styles.css'



export default function Home() {



    return (
        <main className="main">
    <Container className="container">
            {/* <Nav/> */}


            <Grid conatiner direction="column">
                <Grid xs item>
                <h2>Hej, I am Miaomiao</h2>
                </Grid>
                <Grid xs item>
                    <Container>
                        Nav
                    </Container>
                </Grid>
                <Grid xs item>
                    <img src="https://64.media.tumblr.com/a1b757758ee949daf58da67a5235b120/f9f9e4d13cdd0dd3-b2/s1280x1920/3d9a95e842e530ddcb65957ead6e845e91c312b0.png"/>
                </Grid>
            </Grid>


    </Container>
        </main>

    );
}
